# IO编程中，Stream（流）是一个很重要的概念，可以把流想象成一个水管，数据就是水管里的水，但是只能单向流动。Input Stream就是数据从外面（磁盘、网络）流进内存，Output Stream就是数据从内存流到外面去。对于浏览网页来说，浏览器和新浪服务器之间至少需要建立两根水管，才可以既能发数据，又能收数据。
# 本次学习都是同步IO操作

f = open('something.txt', 'r')
print(f.read(20))
f.close()

#the above code can only load the file that code with utf-8,so we can inject a encoding param to load other file
f = open('something.txt', 'r', encoding='gbk')
f.close()
# if the file has some illegal character,we can ignore it
f = open('something.txt', 'r', encoding='gbk', errors='ignore')
f.close()
# evert time we opened a file ,we must closed it at final
# we can use 'with'  to do this job

with open('something.txt', 'r') as f:
    print(f.read(10))


with open('../module/liangzi.jpg', 'rb') as p:
    print(p.read())


# if we want to write it
with open('something.txt', 'w') as f:
    f.write('hi')


# StringIO and BytesIO
# stringIO operate str in ram
# BytesIO operate 010011001010 in ram
from io import StringIO

f = StringIO()
f.write('hello')
print(f.getvalue())

f = StringIO('Hello!\nHi!\nGoodbye!')
while True:
    s = f.readline()
    if s == '':
        break
    print(s.strip())



